sympy.sympy.core.assumptions.getit:
def getit(self):
    try:
        return self._assumptions[fact]
    except KeyError:
        if self._assumptions is self.default_assumptions:
            self._assumptions = self.default_assumptions.copy()
        return _ask(fact, self)

sympy.sympy.core.cache.wrapper:
@wraps(func)
def wrapper(*args, **kwargs):
    try:
        retval = cfunc(*args, **kwargs)
    except TypeError as e:
        if not e.args or not e.args[0].startswith('unhashable type:'):
            raise
        retval = func(*args, **kwargs)
    return retval

sympy.sympy.core.decorators._func:
@wraps(func)
def _func(self, other):
    # XXX: The check for _op_priority here should be removed. It is
    # needed to stop mutable matrices from being sympified to
    # immutable matrices which breaks things in quantum...
    if not hasattr(other, '_op_priority'):
        try:
            other = sympify(other, strict=True)
        except SympifyError:
            return retval
    if not isinstance(other, expectedcls):
        return retval
    return func(self, other)

sympy.sympy.core.decorators.__sympifyit_:
@wraps(func)
def __sympifyit_wrapper(a, b):
    try:
        # If an external class has _op_priority, it knows how to deal
        # with SymPy objects. Otherwise, it must be converted.
        if not hasattr(b, '_op_priority'):
            b = sympify(b, strict=True)
        return func(a, b)
    except SympifyError:
        return retval

sympy.sympy.core.expr.__neg__:
def __neg__(self) -> Expr:
    # Mul has its own __neg__ routine, so we just
    # create a 2-args Mul with the -1 in the canonical
    # slot 0.
    c = self.is_commutative
    return Mul._from_args((S.NegativeOne, self), c)

sympy.sympy.core.expr.__abs__:
def __abs__(self) -> Expr:
    from sympy.functions.elementary.complexes import Abs
    return Abs(self)

sympy.sympy.core.expr.__pow__:
def __pow__(self, other, mod=None) -> Expr:
    power = self._pow(other)
    if mod is None:
        return power
    else:
        try:
            return power % mod
        except TypeError:
            return NotImplemented

sympy.sympy.core.numbers.__eq__:
def __eq__(self, other):
    try:
        other = _sympify(other)
    except SympifyError:
        return NotImplemented
    if self is other:
        return True
    if other.is_Number and self.is_irrational:
        return False

    return False    # NumberSymbol != non-(Number|self)

sympy.sympy.core.numbers.__lt__:
def __lt__(self, other):
    try:
        other = _sympify(other)
    except SympifyError:
        return NotImplemented
    if other.is_Integer:
        return _sympify(self.p < other.p)
    return Rational.__lt__(self, other)

sympy.sympy.core.numbers.__sub__:
def __sub__(self, other):
    if global_parameters.evaluate:
        if isinstance(other, int):
            return Integer(self.p - other)
        elif isinstance(other, Integer):
            return Integer(self.p - other.p)
        elif isinstance(other, Rational):
            return Rational._new(self.p*other.q - other.p, other.q, 1)
        return Rational.__sub__(self, other)
    return Rational.__sub__(self, other)

sympy.sympy.core.numbers.__mul__:
def __mul__(self, other):
    if global_parameters.evaluate:
        if isinstance(other, int):
            return Integer(self.p*other)
        elif isinstance(other, Integer):
            return Integer(self.p*other.p)
        elif isinstance(other, Rational):
            return Rational._new(self.p*other.p, other.q, igcd(self.p, other.q))
        return Rational.__mul__(self, other)
    return Rational.__mul__(self, other)

sympy.sympy.core.numbers.__rmul__:
def __rmul__(self, other):
    if global_parameters.evaluate:
        if isinstance(other, int):
            return Integer(other*self.p)
        elif isinstance(other, Rational):
            return Rational._new(other.p*self.p, other.q, igcd(self.p, other.q))
        return Rational.__rmul__(self, other)
    return Rational.__rmul__(self, other)

sympy.sympy.core.numbers.__pow__:
def __pow__(self, other, mod=None):
    if mod is not None:
        try:
            other_int = as_int(other)
            mod_int = as_int(mod)
        except ValueError:
            pass
        else:
            return Integer(pow(self.p, other_int, mod_int))

    return super().__pow__(other, mod)

sympy.sympy.core.power._half:
def _half(e):
    """Return True if the exponent has a literal 2 as the
    denominator, else None."""
    if getattr(e, 'q', None) == 2:
        return True
    n, d = e.as_numer_denom()
    if n.is_integer and d == 2:
        return True

sympy.sympy.core.power._n2:
def _n2(e):
    """Return ``e`` evaluated to a Number with 2 significant
    digits, else None."""
    try:
        rv = e.evalf(2, strict=True)
        if rv.is_Number:
            return rv
    except PrecisionExhausted:
        pass

sympy.sympy.logic.boolalg.__eq__:
def __eq__(self, other):
    if other is True:
        return False
    if other is False:
        return True
    return super().__eq__(other)
